if modelType == "stateProp_RNN"
    % input: 3 x N in the order of pressure, force, curvature.
    % N is 1 or number of sigma points.
    
    dim = size(stateProp_rnn_weight_ih, 1) / 3 ;
    %hidden = repmat(hidden, 1, size(input,2));
    %input = (input - [norm_pressure(1);norm_force(1);norm_curvature(1)]) ./ [norm_pressure(2);norm_force(2);norm_curvature(2)] ;
    r = stateProp_rnn_weight_ih(1:dim, :) * input + stateProp_rnn_bias_ih(:, 1:dim)' + ...
        stateProp_rnn_weight_hh(1:dim, :) * hidden + stateProp_rnn_bias_hh(:, 1:dim)' ;
    r = 1 ./ (1 + exp(-r)) ;
    z = stateProp_rnn_weight_ih(dim+1:2*dim, :) * input + stateProp_rnn_bias_ih(:, dim+1:2*dim)' + ...
        stateProp_rnn_weight_hh(dim+1:2*dim, :) * hidden + stateProp_rnn_bias_hh(:, dim+1:2*dim)' ;
    z = 1 ./ (1 + exp(-z)) ;
    n = stateProp_rnn_weight_ih(2*dim+1:3*dim, :) * input + stateProp_rnn_bias_ih(:, 2*dim+1:3*dim)' + ...
        r .* (stateProp_rnn_weight_hh(2*dim+1:3*dim, :) * hidden + stateProp_rnn_bias_hh(:, 2*dim+1:3*dim)' );
    n = tanh(n);
    output = (1 - z) .* n + z .* hidden ;
    %output = stateProp_rnn_weight1 * hidden + stateProp_rnn_bias1';
    %output = output .* norm_curvature(2) + norm_curvature(1) ;
    %hidden = hidden(:,1);
    
elseif modelType == "hidden2state"

    output = stateProp_rnn_weight1 * input + stateProp_rnn_bias1';
                     
elseif modelType == "measurement_FC"
    % input: 2 x N matrix in the order of pressure, state.
    % N is 1 or number of sigma points.
    % Simple FC, no hidden required.
    
%     dim = size(measurement_rnn_weight_ih, 1) / 3 ;
%     hidden = repmat(hidden, 1, size(input,2));
    if nargin < 3
        hidden = 0;
    end
    %input = (input - [norm_pressure(1);norm_curvature(1)]) ./ [norm_pressure(2);norm_curvature(2)] ;
    output = measurement_fc_weight1 * input + measurement_fc_bias1';
    output(output < 0) = 0 ;
    output = measurement_fc_weight2 * output + measurement_fc_bias2';
    %output = output .* norm_flex(2) + norm_flex(1) ;
%     r = measurement_rnn_weight_ih(1:dim, :) * input + measurement_rnn_bias_ih(:, 1:dim)' + ...
%         measurement_rnn_weight_hh(1:dim, :) * hidden + measurement_rnn_bias_hh(:, 1:dim)' ;
%     r = 1 ./ (1 + exp(-r)) ;
%     z = measurement_rnn_weight_ih(dim+1:2*dim, :) * input + measurement_rnn_bias_ih(:, dim+1:2*dim)' + ...
%         measurement_rnn_weight_hh(dim+1:2*dim, :) * hidden + measurement_rnn_bias_hh(:, dim+1:2*dim)' ;
%     z = 1 ./ (1 + exp(-z)) ;
%     n = measurement_rnn_weight_ih(2*dim+1:3*dim, :) * input + measurement_rnn_bias_ih(:, 2*dim+1:3*dim)' + ...
%         r .* (measurement_rnn_weight_hh(2*dim+1:3*dim, :) * hidden + measurement_rnn_bias_hh(:, 2*dim+1:3*dim)' );
%     n = tanh(n);
%     hidden = (1 - z) .* n + z .* hidden ;
%     output = measurement_rnn_weight1 * hidden + measurement_rnn_bias1';
%     output = output .* norm_flex(2) + norm_flex(1) ;
%     hidden = hidden(:,1);
    
elseif modelType == "forceEst_RNN" % exteroceptive module
    % input: 2 x 1 matrix in the order of pressure, state.
    
    dim = size(forceEst_rnn_weight_ih, 1) / 3 ;
%     hidden = repmat(hidden, 1, size(input,2));
    %input = (input - [norm_pressure(1);norm_curvature(1)]) ./ [norm_pressure(2);norm_curvature(2)] ;
    r = forceEst_rnn_weight_ih(1:dim, :) * input + forceEst_rnn_bias_ih(:, 1:dim)' + ...
        forceEst_rnn_weight_hh(1:dim, :) * hidden + forceEst_rnn_bias_hh(:, 1:dim)' ;
    r = 1 ./ (1 + exp(-r)) ;
    z = forceEst_rnn_weight_ih(dim+1:2*dim, :) * input + forceEst_rnn_bias_ih(:, dim+1:2*dim)' + ...
        forceEst_rnn_weight_hh(dim+1:2*dim, :) * hidden + forceEst_rnn_bias_hh(:, dim+1:2*dim)' ;
    z = 1 ./ (1 + exp(-z)) ;
    n = forceEst_rnn_weight_ih(2*dim+1:3*dim, :) * input + forceEst_rnn_bias_ih(:, 2*dim+1:3*dim)' + ...
        r .* (forceEst_rnn_weight_hh(2*dim+1:3*dim, :) * hidden + forceEst_rnn_bias_hh(:, 2*dim+1:3*dim)' );
    n = tanh(n);
    hidden = (1 - z) .* n + z .* hidden ;
    output = forceEst_rnn_weight1 * hidden + forceEst_rnn_bias1';
    %output = output .* norm_force(2) + norm_force(1) ;
%     hidden = mean(hidden, 2);

elseif modelType == "direct_RNN" % thuruthel 
    % input: 2 x 1 matrix in the order of pressure, flex.
    
    dim = size(direct_rnn_weight_ih, 1) / 3 ;
    %input = (input - [norm_pressure(1);norm_flex(1)]) ./ [norm_pressure(2);norm_flex(2)] ;
    r = direct_rnn_weight_ih(1:dim, :) * input + direct_rnn_bias_ih(:, 1:dim)' + ...
        direct_rnn_weight_hh(1:dim, :) * hidden + direct_rnn_bias_hh(:, 1:dim)' ;
    r = 1 ./ (1 + exp(-r)) ;
    z = direct_rnn_weight_ih(dim+1:2*dim, :) * input + direct_rnn_bias_ih(:, dim+1:2*dim)' + ...
        direct_rnn_weight_hh(dim+1:2*dim, :) * hidden + direct_rnn_bias_hh(:, dim+1:2*dim)' ;
    z = 1 ./ (1 + exp(-z)) ;
    n = direct_rnn_weight_ih(2*dim+1:3*dim, :) * input + direct_rnn_bias_ih(:, 2*dim+1:3*dim)' + ...
        r .* (direct_rnn_weight_hh(2*dim+1:3*dim, :) * hidden + direct_rnn_bias_hh(:, 2*dim+1:3*dim)' );
    n = tanh(n);
    hidden = (1 - z) .* n + z .* hidden ;
    output = direct_rnn_weight1 * hidden + direct_rnn_bias1';
    %output = output .* [norm_force(2); norm_curvature(2)] + [norm_force(1); norm_curvature(1)] ;
else
    error("Invalid type given.")
end

